import React, { Component } from 'react'

import Project from './Project'

import {
  HeaderContainer,
  Header,
  StyledWorkSection
} from './Work.styles'

const Work = props => {
  return (
    <StyledWorkSection>
      <HeaderContainer>
        <Header>And here's some of my work:</Header>
      </HeaderContainer>
      <Project purpose="Music Album List Maker" source="https://res.cloudinary.com/fsuffieldcode/image/upload/v1584229261/tenners-responsive-mockup.jpg"/>
    </StyledWorkSection>
  )
}

export default Work
